65s3b968eXOY9+H65s2bN2/eHOZ9uL558+bNmzeHeR+ub968efPmzWHeh+ubN2/evHlzmPfh+ubNmzdv3hzl11//DxofRZU5w2WyAAAAAElFTkSuQmCC\",\"mime\":\"image/png\",\"copyright\":{\"license\":\"U\"},\"width\":471,\"height\":209},\"alt\":\"EAN-13 Barcode\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Bild\",\"license\":\"U\",\"title\":\"Unbenannt: Bild\",\"authors\":[],\"changes\":[]},\"subContentId\":\"ffb08c5f-05ba-4599-8872-f9ff3ee2c726\"},{\"params\":{\"text\":\"<p> </p>\\n\\n<p><strong>Die Lösungszahl ist die zweite Ziffer der Länderkennung (bzw. des Länderpräfix).</strong></p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Unbenannt: Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"b514e5d3-3979-4f86-9b8e-69c86c5a5e0b\"}],\"header\":\"Barcodes (EAN)\"},{\"position\":{\"x\":11.223698840100873,\"y\":34.60843323891707},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Zur digitalen Verarbeitung von Texten müssen deren einzelne Zeichen zunächst codiert werden. Hierfür wird häufig der <strong>ASCII</strong>-Code (<strong>A</strong>merican <strong>S</strong>tandard <strong>C</strong>ode for <strong>I</strong>nformation <strong>I</strong>nterchange) verwendet. </p>\\n\\n<p> </p>\\n\\n<p>Ermitteln Sie den ASCII-Code (Dezimalzahl) des häufigsten Buchstabens in folgendem Namen:</p>\\n\\n<h2 style=\\\"text-align:center\\\">ADA LOVELACE</h2>\\n\\n<p> </p>\\n\\n<p><strong>Die Lösungszahl ist der Wert des Quotienten der gefundenen Dezimalzahl und 5.</strong></p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Unbenannt: Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"59bace36-c3d0-44bf-93a6-c4218788d6a3\"}],\"header\":\"ASCII (Codierung von Zeichen)\"},{\"position\":{\"x\":23.850360035214354,\"y\":28.84464956195244},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Samuel F. B. Morse erfand im Jahr 1837 zu Zeiten der Telegrafie den <strong>Morsecode</strong>, um komplexe Informationen übermitteln zu können. Da bei der Telegrafie im Gegensatz zum Sprechfunk und der Telefonie nicht gesprochen wird, stellte dies einen entscheidenden Fortschritt dar.</p>\\n\\n<p> </p>\\n\\n<p>Die Buchstaben und Zeichen werden hierbei durch Kombinationen aus kurzen Signalen (Punkte) und langen Signalen (Striche) codiert. Recherchieren Sie zum Morsecode und codieren Sie damit das Wort <em>CODE</em>.</p>\\n\\n<p> </p>\\n\\n<p><strong>Die Lösungszahl ist die Anzahl der Striche (lange Signale), die insgesamt zur Übertragung des Begriffs <em>CODE</em> in Morsecode benötigt werden.</strong></p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Unbenannt: Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"cd74f301-1290-4f5a-a857-0c34aaacbe32\"}],\"header\":\"Morsecode\"},{\"position\":{\"x\":14.731104727632397,\"y\":18.552178710229896},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Um Übermittlungs- oder Tippfehler zu verhindern enthalten Codes wie z.B. EAN, GTIN oder ISBN eine sogenannte <strong>Prüfziffer </strong>am Ende. </p>\\n\\n<p> </p>\\n\\n<p>Recherchieren Sie, wie die Prüfziffer einer <strong>GTIN</strong> (<strong>G</strong>lobal <strong>T</strong>rade <strong>I</strong>tem <strong>N</strong>umber) berechnet wird. Ermitteln Sie anschließend die Prüfziffer des folgenden Codes:</p>\\n\\n<p> </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Unbenannt: Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"2a11c042-1c1b-40b7-b504-fb97a66cdeab\"},{\"params\":{\"decorative\":false,\"contentName\":\"Bild\",\"expandImage\":\"Bild vergrößern\",\"minimizeImage\":\"Bild verkleinern\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABJAAAAFgCAYAAADkeoOXAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAFiUAABYlAUlSJPAAAAGHaVRYdFhNTDpjb20uYWRvYmUueG1wAA ng>Die Lösungszahl ist die Summe aus der Zahl des Bundeslandes und zehn.</strong></p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Unbenannt: Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"3deed136-d5be-4ad6-94fc-b9f26a049d98\"}],\"header\":\"Eiercode\"},{\"position\":{\"x\":77.39675658486227,\"y\":45.93015117581187},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Die gegebene Folge von Nullen und Einsen codiert eine Pixelgrafik gemäß folgender Regeln:</p>\\n\\n<p><em>Die ersten 8 Bit stehen für die Breite, die nächsten 8 Bit für die Höhe der Grafik. Dann folgen die Pixel für schwarze (1) und weiße (0) Bildpunkte der Grafik von oben links nach unten rechts.</em></p>\\n\\n<p> </p>\\n\\n<p>Erstellen Sie aus untenstehendem Code die zugehörige Pixelgrafik. Nutzen Sie hierfür z. B. ein kariertes Blatt Papier oder ein Pixel Art Tool.</p>\\n\\n<h3>00001100 00001001 00000000 00000001 00011000 00110010 10000001 01001000 00010111 11000001 00001000 00010000 10000011 10001000 00000000 0000</h3>\\n\\n<p> </p>\\n\\n<p><strong>Die Lösungszahl kann der Grafik direkt entnommen werden.</strong></p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Unbenannt: Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"74dcd8e8-8383-445d-98db-eacd07840265\"}],\"header\":\"Codierung einer Pixelgrafik\"},{\"position\":{\"x\":86.749838951613,\"y\":72.6905753902905},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Viele der heute gebräuchlichen Schriftsysteme sind Tausende von Jahren alt. Demgegenüber ist digitaler Text relativ neu. <strong>Unicode</strong> ist ein einheitliches System zur Darstellung von Schriftzeichen aller Sprachen. Dadurch wird die Kommunikation in verschiedenen Schriftsystemen (z. B. Lateinisch, Chinesisch, Arabisch) sowie die Nutzung von Symbolen und Emojis ermöglicht.</p>\\n\\n<p> </p>\\n\\n<p>Die Idee von Unicode ist, ein Zeichen von seiner visuellen Darstellung zu trennen: Ein \\\"A\\\" ist ein \\\"A\\\", unabhängig von der verwendeten Schriftart. Jedem Zeichen wird hierzu ein sogenannter Codepoint zugeordnet, der üblicherweise in Hexadezimalschreibweise dargestellt wird und mit \\\"U+\\\" beginnt, z. B.: </p>\\n\\n<ul>\\n\\t<li>U+0041 → Buchstabe \\\"A\\\"</li>\\n\\t<li>U+1F984 → 🦄 (Einhorn)</li>\\n</ul>\\n\\n<p> </p>\\n\\n<p>Wandeln Sie folgenden Unicode in Emojis um:</p>\\n\\n<h3 style=\\\"text-align:center\\\">U+1FA85 U+2753 U+27A1 U+33 U+2705</h3>\\n\\n<p> </p>\\n\\n<p><strong>Die Lösungszahl finden Sie über die Emojis. </strong></p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Unbenannt: Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"b9582f8b-d673-4542-90e5-42e7cdf5d242\"}],\"header\":\"Unicode und Emojis\"}],\"hotspotNumberLabel\":\"Hotspot Nummer #num\",\"closeButtonLabel\":\"Schließen\",\"containsAudioVideoLabel\":\"Contains Audio/Video\",\"iconImage\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAcMAAAHDCAYAAABYhnHeAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsQAAA7EAZUrDhsAADuTSURBVHhe7d1XWJTn2vZxk3dJrwNIVwQUEUTsDcXee4u99x67xq6x95poNDHGJJqoURMToyb2BBULihUVKyBIr2atN9/G+tbr4pIywPT5/zbPaw43PIbnnPt+2nt///13KQAAjNn7MgAAwNhQhgAAo0cZAgCMHmUIADB6lCEAwOhRhgAAo0cZAgCMHmUIADB673HTPaCchORE1+evXvq8ePXS53ncS5/nr176vIiP8X4R+9InKT3FSX5eE6wtrZPcnVwfejq7PvRwdn/oXsbtobuT6yMPZ7eHzgqnZ/LzAPJGGQL/5W3Zxfg8i3vu+yIuxud5/EufF3EvvbP/emMhP6/rvFw973g4uz30cHZ/6FHGLcrD2e2hZxn3KE8X9wfys4AxowxhtN789cbsxv3IBlfv3gi9djei0dV7EaHyM4YsqELAxeqVgs5Ur1T1TLBflXNmJqaZ8jOAsaAMYTSycrItIx5E1r9y+1rTG/duhlx/EBkiP2PMAn39/wyuWOV8zcrBvwVXDDxvYWaRJj8DGCrKEAYrKyfb8sb9WyHhd643Dr97o/GtqDt15WeQv0peFa/Uqhz8e3X/qqer+VU5RznCkFGGMCi3Ht6pc/bqxU5Xbl9veuvhnTpyjuKr5FXxSq2Aar+FVq9/OKhCwEU5B/QZZQi9d+NBZIPfLp3t/vvls11jE+PLyjlUz9HO8UWz2g0PNKvV6Ptgvyrn5BzQN5Qh9NL1ezcbngg7/cHp8HNd4pMS3eQcmqOwUcQ2qdXgUPPaod/V8A/+Xc4BfUAZQm/EJMSVO3r2lyE/njsxIP
